CREATE DEFINER=`root`@`localhost` PROCEDURE `calculate_new_levels`(
input_symbol VARCHAR(45))
BEGIN

declare  avg_volume_till_time float;

declare  count_avg int;

declare  direction_volume_till_time float;

declare  sum_volume_till_time float;

declare  avg_data_time float;

declare var_price_mode float(10,2);

declare  input_time datetime;

declare  calculated_signal int;

declare var_max_count_mode int;



select max(curr_time) from  live_data
where symbol =  input_symbol
into input_time;

-- set input_time =   '2017-08-11 12:55:14';



/*
call get_avg_volume_till_time
(input_time, input_symbol,current_volume,avg_volume_till_time);

*/


DELETE  FROM live_data_staging_calculation;

ALTER TABLE live_data_staging_calculation AUTO_INCREMENT =1;

replace into live_data_staging_calculation(
curr_time,symbol,volume,price)(
SELECT curr_time,symbol,volume,price FROM live_data
where symbol = input_symbol
and curr_time <= input_time
order by curr_time asc
);



select avg(timestampdiff(SECOND,previousRow.curr_time,currentRow.curr_time))
from live_data_staging_calculation currentRow, live_data_staging_calculation previousRow
where 1=1
and currentRow.id = previousRow.id + 1
into avg_data_time;


select
avg(currentRow.volume - previousRow.volume) , count(*)
-- previousRow.volume,currentRow.volume
from live_data_staging_calculation currentRow, live_data_staging_calculation previousRow
where   1=1
-- and currentRow.symbol = input_symbol
-- and previousRow.symbol =  input_symbol
and timestampdiff(SECOND,previousRow.curr_time,currentRow.curr_time) < 2 * avg_data_time
and currentRow.id = previousRow.id + 1
and currentRow.volume - previousRow.volume != 0
into  avg_volume_till_time,count_avg;


select

sum(currentRow.volume - previousRow.volume)

from live_data_staging_calculation currentRow, live_data_staging_calculation previousRow
where   1=1
-- and currentRow.symbol = input_symbol
-- and previousRow.symbol =  input_symbol
and timestampdiff(SECOND,previousRow.curr_time,currentRow.curr_time) < 2 * avg_data_time
and currentRow.id = previousRow.id + 1
-- and currentRow.price < previousRow.price
and (currentRow.volume - previousRow.volume) > ( 1.5 * avg_volume_till_time)
into sum_volume_till_time;


select

sum(

(abs(currentRow.price - previousRow.price) /  (currentRow.price - previousRow.price))

* (currentRow.volume - previousRow.volume)
)
from live_data_staging_calculation currentRow, live_data_staging_calculation previousRow
where   1=1
-- and currentRow.symbol = input_symbol
-- and previousRow.symbol =  input_symbol
and timestampdiff(SECOND,previousRow.curr_time,currentRow.curr_time) < 2 * avg_data_time
and currentRow.id = previousRow.id + 1
-- and currentRow.price < previousRow.price
and (currentRow.volume - previousRow.volume) > ( 1.5 * avg_volume_till_time)
into direction_volume_till_time;

if(   abs(direction_volume_till_time) > (sum_volume_till_time / 15)   ) then

set calculated_signal =   abs(direction_volume_till_time) / direction_volume_till_time;

    update basis_for_calls
    set curr_signal = calculated_signal
    where symbol = input_symbol;

end if;

DELETE  FROM live_data_staging_mode_calculation;

ALTER TABLE live_data_staging_mode_calculation AUTO_INCREMENT =1;

replace into live_data_staging_mode_calculation(
curr_time,symbol,volume,price)(
SELECT previousRow.curr_time,previousRow.symbol,previousRow.volume,previousRow.price
from live_data_staging_calculation currentRow, live_data_staging_calculation previousRow
where   1=1
-- and currentRow.symbol = input_symbol
-- and previousRow.symbol =  input_symbol
and timestampdiff(SECOND,previousRow.curr_time,currentRow.curr_time) < 2 * avg_data_time
and currentRow.id = previousRow.id + 1
-- and currentRow.price < previousRow.price
and (currentRow.volume - previousRow.volume) > ( 1.5 * avg_volume_till_time)
order by curr_time asc
);


call calculate_mode_levels(var_price_mode,var_max_count_mode);

if(var_price_mode is not null or var_price_mode > 0  ) then
call alter_levels(input_symbol,var_price_mode,var_max_count_mode);
end if;


END ;;
